@padd_hurst Our apologies for the delayed baggage.
Please send us a direct message with:
● your full name;
● six-letter reservation code;
● where you flew from and to;
● delayed baggage reference number and/or bag tag numbers; and,
● email address on the baggage claim. https://t.co/o7MlHGd5Wh

@carriemae68 Our apologies for the interruption to your Mom's travel plans.
If you need our help, please send us a direct message with your request, their full name, reservation code and where they flew from and to.
Also, where were you checking the flight status? https://t.co/o7MlHGd5Wh

@cdemrys Thank you for connecting with us regarding your Air Passenger Protection Regulations (APPR) claim.
We regret your concerns cannot be addressed here. We have a specialized team that processes APPR claims.
If you received an email from the APPR team, you're welcome to reply to it.

@Darrenrp Our apologies for the frustration you’re feeling.
Our contact centre is very busy!
If you need our help, please send us a direct message with your request, your full name, reservation code and where you are flying from and to. https://t.co/o7MlHGd5Wh
